import React from "react";
import Carousel from "react-spring-3d-carousel";
import { v4 as uuidv4 } from "uuid";

const slides = [
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/800/800?image=0" alt="Slide 1" />
  },
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/800/800?image=1" alt="Slide 2" />
  },
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/800/800?image=2" alt="Slide 3" />
  },
  // Add more slides if needed
];

const CircularImageCarousel = () => {
  return (
    <div style={{ width: "80%", height: "500px", margin: "0 auto" }}>
      <Carousel
        slides={slides}
        offsetRadius={2}
        showNavigation={true}
        animationConfig={{ tension: 120, friction: 14 }}
      />
    </div>
  );
};

export default CircularImageCarousel;
